product.description:
До складу набору входять косметичка, шампунь, бальзам та олія. Лінію засобів Gliss Ultimate Repair з рідким кератином та екстрактом перлини розроблено спеціально для задоволення потреб дуже пошкодженого та сухого волосся. 
Зміцнюючий шампунь Gliss Ultimate Repair пропонує:
- Дбайливе очищення;
- Глибоке відновлення структури волосся;
- До 90% більше стійкості**за умови застосування разом з бальзамом Gliss Ultimate Repair.
Особливості:
- для сильно пошкодженого та сухого волосся;
- Рідкий кератин та екстракти перлини;
- Піклування про тебе: 89% інгредієнтів природного походження;
- Піклування про навколишнє середовище: пляшка на 30% складаєтьcя з переробленого пластику.
Олія Gliss Daily Oil Elixir забезпечить екстремальне відновлення, стійкість та блиск.
- Арганова олія;
- Вітамін Е;
- Живлення для розкішного волосся;
- Без жирних слідів.
Основою формули Gliss є активні діючі речовини та дари природи для відновлення волосся та попередження його майбутнього пошкодження.
Gliss рекомендує наступні кроки для комплексного догляду за волоссям:
1. Шампунь для очищення;
2. Бальзам для м'якості;
3. Експрес-кондиціонер для легкого розчісування;
4. Спеціальні засоби для глибокого відновлення (маска для волосся, олія). Роби, що ти любиш. Gliss відновлює.
